import React from 'react';

const BrandDetails = ({ brands }) => {
  return (
    <div className='brand-details'>
      <h3>BRANDS</h3>
      <table>
        <thead>
          <tr>
            <th>Brand</th>
            <th>Edit</th>
            <th>Delete</th>
          </tr>
        </thead>
        <tbody>
          {brands.map((brand, index) => (
            <tr key={index}>
              <td>{brand}</td>
              <td>
                <input type='text' placeholder='Enter new brand' />
              </td>
              <td>
                <button>Edit</button>
                <button>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default BrandDetails;
